import logoGconn from '../../image/logo-gconn-nobackground.png';
import './NavbarBeforeLogin.css';

function NavbarBeforeLogin(){
    return(
        <div>
            <span>
                <img className='logo' src={logoGconn} alt="" />
            </span>
        </div>
    );
}

export default NavbarBeforeLogin;
